import React from 'react';
import { useSelector } from 'react-redux';

function App() {
  const counter = useSelector((state) => state.counter);
  const isLogged = useSelector((state) => state.sisLogged);

  return (
    <div className='App'>
      <h1>Counter {counter}</h1>

      {isLogged ? (
        <h3>Valuable info I shouldnt see if I am not logged in</h3>
      ) : (
        ''
      )}
    </div>
  );
}

export default App;
